-- -- -- Create the database "Football" if it does not exist
-- -- -- CREATE DATABASE Football;

-- -- -- USE Football;



DROP TABLE IF EXISTS Leagues_Teams, TeamMatches, InternationalMatches, Teams, Leagues, Countries,players,clubs,manager,stadium;

CREATE TABLE `Countries` (
    `CountryCode` VARCHAR(10) NOT NULL PRIMARY KEY,
    `CountryName` VARCHAR(50) NOT NULL
);

CREATE TABLE `Stadium` (
	`StadiumId` INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
    `StadiumName` VARCHAR(255) NOT NULL,
    `Location` VARCHAR(255) NOT NULL,
    `Capacity` BIGINT NOT NULL
);

CREATE TABLE `Manager` (
    `ManagerId` INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
	`CountryCode` VARCHAR(10) NOT NULL,
    `ManagerName` VARCHAR(50) NOT NULL,
    `Age` INT NOT NULL,
	FOREIGN KEY (`CountryCode`) REFERENCES `Countries`(`CountryCode`)
);
DROP TABLE teams

CREATE TABLE `Teams` (
    `TeamId` INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    `TeamName` VARCHAR(50) NOT NULL,
    `CountryCode` VARCHAR(10) NOT NULL,
    `LeagueId` INT UNSIGNED NOT NULL,
    `ManagerId` INT UNSIGNED NOT NULL,
    `StadiumId` INT UNSIGNED NOT NULL,
    `LeagueRank` INT,
    `MP` INT,
    `W` INT,
    `D` INT,
    `L` INT,
    `GF` INT,
    `GA` INT,
    `GD` INT,
    `Pts` INT,
    `PtsPerMP` FLOAT,
    `xG` FLOAT,
    `xGA` FLOAT,
    `xGD` FLOAT,
    `xGDPer90` FLOAT,
    `Attendance` INT UNSIGNED NOT NULL,
    FOREIGN KEY (`StadiumId`) REFERENCES `Stadium`(`StadiumId`),
    FOREIGN KEY (`ManagerId`) REFERENCES `Manager`(`ManagerId`),
    FOREIGN KEY (`LeagueId`) REFERENCES `Leagues`(`LeagueId`),
    FOREIGN KEY (`CountryCode`) REFERENCES `Countries`(`CountryCode`)
);
drop TABLE players

CREATE TABLE `Players` (
    `PlayerId` INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    `PlayerName` VARCHAR(75) NOT NULL,
    `Position` VARCHAR(20) NOT NULL,
    `TeamId` INT UNSIGNED NOT NULL,
    `MatchesPlayed` INT,
    `Starts` INT,
    `MinutesPlayed` BIGINT,
    `MinutesPlayedPer90` FLOAT,
    `Goals` INT,
    `Assists` INT,
    `SumGoalsAssists` INT,
    `NonPenaltyGoals` INT,
    `PenaltiesMade` INT,
    `PenaltiesAttempted` INT,
    `YellowCards` INT,
    `RedCards` INT,
    `ExpectedGoalsxG` FLOAT,
    `NonPenaltyGoalsnpxG` FLOAT,
    `ExpectedAssistedGoalsxAG` FLOAT,
    `npxG+xAG` FLOAT,
    `ProgressiveCarries` INT,
    `ProgressivePasses` INT,
    `ProgressivepassesReceived` INT,
    `Per90MinutesGoals` FLOAT,
    `Per90MinutesAssists` FLOAT,
    `Per90MinutesG+A` FLOAT,
    `Per90MinutesNonPenaltyGoals` FLOAT,
    `Per90MinutesG+A-PK` FLOAT,
    `Per90MinutesxG` FLOAT,
    `Per90MinutesxAG` FLOAT,
    `Per90MinutesxG+xAG` FLOAT,
    `Per90MinutesnpxG` FLOAT,
    `Per90MinutesnpxG+xAG` FLOAT,
    `CountryCode` VARCHAR(10) NOT NULL,
    `PlayerAge` INT NOT NULL,
    FOREIGN KEY (`TeamId`) REFERENCES `Teams`(`TeamId`),
    FOREIGN KEY (`CountryCode`) REFERENCES `Countries`(`CountryCode`)
);

drop table Players ;

CREATE TABLE `Leagues` (
    `LeagueId` INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    `LeagueName` VARCHAR(30) NOT NULL,
    `CountryCode` VARCHAR(10) NOT NULL,
    FOREIGN KEY (`CountryCode`) REFERENCES `Countries`(`CountryCode`)
);

